  <>
  {/* render the multiple element in jsx */}
    <h1>Prasad Kale Netflix Pick</h1>
    <p>List Of 5 Best Series</p>
    <ol>
      <li>Dark</li>
      <li>Extra Curricular</li>
      <il></il>
    </ol>
  </>,
  document.getElementById("root")
);
